import React from 'react';
import { View, Text, Button, StyleSheet } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack';
import Driving from '../pages/Driving';
import Energy from '../pages/Energy';
import Footer from '../Footer';
import Navbar from '../Navbar';

const Stack = createStackNavigator();

function TrackOptions({ navigation }) {
    return (
        <View>
            <Text>Choose an option:</Text>
            <Button
                title="Driving"
                onPress={() => navigation.navigate('Driving')}
            />
            <Button
                title="Energy"
                onPress={() => navigation.navigate('Energy')}
            />
        </View>
    );
}

function TrackNav() {
    return (
        <View style={{ flex: 1 }}>
            <Navbar />
            <Stack.Navigator style={styles.navigator}>
                <Stack.Screen
                    name="Track"
                    component={TrackOptions}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Driving"
                    component={Driving}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Energy"
                    component={Energy}
                    options={{ headerShown: false }}
                />
            </Stack.Navigator>
            <Footer />
        </View>
    );
}

const styles = StyleSheet.create({
    navigator: {
        marginTop: -100,
    },
});

export default TrackNav;
